css:
.print-heading {
	text-align: right;
	text-transform: uppercase;
	color: #666;
	padding-bottom: 20px;
	margin-bottom: 20px;
	border-bottom: 1px solid #d1d8dd;
}

.print-heading h2 {
	font-size: 24px;
}

.print-format th {
	background-color: #eee !important;
	border-bottom: 0px !important;
}

.print-format .primary.compact-item {
    font-weight: bold;
}
@font-face {
    font-family: 'Battambang';
    font-style: normal;
    font-weight: 400;
    font-display: swap;
    src: url(https://fonts.gstatic.com/s/battambang/v14/uk-mEGe7raEw-HjkzZabPnmp4g.woff2) format('woff2');
    unicode-range: U+1780-17FF, U+200C, U+25CC, U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
}

.print-format:lang(km) {
    font-family: Battambang;
    /* font-weight: 400;
    font-size: 16px; */
    /* color: #383838; */
    line-height: 1.8;
}
